import React, { useContext, useEffect } from "react";
import ShowActivities from "../components/ShowActivities";
import InputActivity from "../components/InputActivity";
import { Global } from "../App";

function Activity() {
  const context = useContext(Global);
  return (
    <div>
      <div className="carebox">
        <div>
          <h1 className="text-white abouth1 text-center">Activities</h1>
          {context.isInput === false ? (
            <button
              className="btn"
              onClick={() => {
                context.HandleIsInput();
              }}
            >
              Add Exercise
            </button>
          ) : (
            <InputActivity />
          )}
          {!context.data ? (
            <h1 className="display-3  pb-5">No Activities Yet</h1>
          ) : (
            <ShowActivities />
          )}{" "}
        </div>
      </div>
    </div>
  );
}

export default Activity;
